import './App.css';
import Login from './Components/Login';
import Register from './Components/Register';
import { BrowserRouter, Route, Routes  } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/register" element
           />
        </Routes>
      </BrowserRouter>
      <Register />
      <Login />
    </div>
  );
}

export default App;
